N:int = 1024;
n:int = 16
i:int = 0
j:int = 0

def mm( n:int, A:[[int]],  B:[[int]],  C:[[int]])->object:
    i:int=0
    j:int=0
    k:int=0

    while i < n:
        j = 0
        while j < n:
            C[i][j] = 0
            j = j + 1
        i = i + 1

    i = 0
    k = 0
    j = 0

    while k < n:
        i = 0
        while i < n:
            j = 0;
            while j < n:
                C[i][j] = C[i][j] + A[i][k] * B[k][j]
                j = j + 1
            i = i + 1
        k = k + 1

def get_random(a:int,b:int,c:int)->int:
    return ((a*c)+b) % 100

A:[[int]]=None
B:[[int]]=None
C:[[int]]=None

